                    "x": -192.0,
                    "y": -24.0,
                    "data": "\u8fd9,\u5c31\u662f\u6700\u9ad8\u7ea7\u7684GT++\u6750\u6599.\u5b83\u9700\u8981UIV\u7535\u538b\u624d\u80fd\u52a0\u5de5.\u6240\u4ee5\u73b0\u5728\u4f60\u53ea\u80fd\u7528GT++\u7684\u5927\u578b\u52a0\u5de5\u5382\u56fa\u5316\u5b83.</br></br>[note]\u53ea\u8981\u62ff\u5230\u4e86\u7b2c\u4e00\u5757\u952d,\u5c31\u53ef\u4ee5\u7528\u8d85\u7ef4\u5ea6\u7b49\u79bb\u5b50\u953b\u7089(DTPF)\u5236\u53d6\u66f4\u591a\u4e86.\u6211\u60f3\u90a3\u4e2a\u914d\u65b9\u5e94\u8be5\u6bd4\u7528MK4\u6838\u805a\u53d8\u597d\u591a\u4e86.[/note]</br></br>[note]\u8fd9\u5757\u86cb\u7cd5\u5c31\u662f\u5bf9\u4f60\u8d70\u5230\u8fd9\u4e00\u6b65\u7684\u5956\u52b1.[/note]",
