                    "x": -192.0,
                    "y": 60.0,
                    "data": "\u4f60\u9700\u8981\u9f99\u8840\u5236\u9020\u7b2c\u4e00\u6279\u6d77\u73c0\u73cd.\u4e5f\u8bb8\u4f60\u5df2\u7ecf\u6709\u4e86\u4e9b\u9f99\u8840,\u662f\u5f88\u4e45\u4ee5\u524d\u51fb\u6740\u672b\u5f71\u9f99\u6389\u843d\u7684,\u6b63\u8eba\u5728\u67d0\u4e2a\u5730\u65b9.\u4e0d\u8fc7\u8fd8\u6709\u4e24\u4e2a\u5176\u4ed6\u9009\u62e9:\u871c\u8702\u548c\u9f99\u7814\u805a\u5408\u88c5\u7f6e(DE Fusion Crafter).</br></br>\u5bf9\u4e8e\u871c\u8702\u8def\u7ebf,\u4f60\u9700\u8981\u6df1\u5165\u7814\u7a76\u871c\u8702\u57f9\u80b2\u7ebf,\u4f46\u8bf4\u4e0d\u5b9a\u4f60\u5df2\u7ecf\u5b8c\u6210\u4e86?\u4e0d\u8bba\u5982\u4f55,\u770b\u770b\"\u871c\u8702\u80b2\u79cd\"\u4efb\u52a1\u680f\u5427.</br></br>\u5728\u9f99\u7814\u805a\u5408\u88c5\u7f6e\u4e2d\u6709\u4e24\u4e2a\u914d\u65b9.\u8f83\u597d\u7684\u4e00\u4e2a\u8981\u7528\u5230\u5deb\u672fmod\u7684\u65e0\u9650\u4e4b\u86cb.\u5982\u679c\u4f60\u6ca1\u6709\u5deb\u672f\u8fdb\u5ea6\u7684\u8bdd,\u5c31\u53ea\u80fd\u7528\u666e\u901a\u9f99\u86cb,\u4f7f\u7528\u8f83\u5f31\u7684\u914d\u65b9\u4e86.</br></br>\u53ea\u8981\u4f60\u6709\u4e86\u4e9b\u6d77\u73c0\u73cd,\u5c31\u80fd\u4ee5\u6b64\u5f00\u59cb\u5728\u8d85\u7ef4\u5ea6\u7b49\u79bb\u5b50\u953b\u7089(DTPF)\u4e2d\u5236\u9020\u66f4\u591a,\u800c\u4e0d\u9700\u8981\u9f99\u8840\u4e86.\u6211\u4e0d\u77e5\u9053\u4e3a\u4f55\u8fd9\u4e48\u8bbe\u8ba1,\u8981\u62b1\u6028\u5c31\u627eColen\u5427.\u4e0d\u8fc7,\u4f60\u6700\u7ec8\u8fd8\u662f\u9700\u8981\u66f4\u591a\u7684\u9f99\u8840,\u4ee5\u5236\u9020UMV\u8d85\u5bfc.</br></br></br>[note]\u5b9e\u9645\u4e0a\u8fd8\u6709\u53e6\u4e00\u79cd\u65b9\u6cd5\u83b7\u5f97\u9f99\u8840,\u8fd9\u4e0e\u9f99\u7814\u805a\u5408\u88c5\u7f6e\u7684\u914d\u65b9\u76f8\u4f3c,\u4e0d\u8fc7\u662f\u7528\u6405\u62cc\u673a.\u5b83\u7684\u901f\u5ea6\u66f4\u6162,\u8d44\u6e90\u5229\u7528\u7387\u66f4\u4f4e.\u5c24\u5176\u8981\u6ce8\u610f\u7684\u662f,\u8fd9\u4e2a\u914d\u65b9\u4f1a\u6d88\u8017\u9f99\u86cb.\u6240\u4ee5\u53ea\u6709\u5728\u4f60\u9700\u8981\u5b8c\u5168\u907f\u5f00\u9b54\u6cd5\u548c\u871c\u8702\u7ebf\u7684\u65f6\u5019,\u624d\u4f1a\u4f7f\u7528\u8fd9\u4e2a\u914d\u65b9.[/note]</br></br>[note]\u6d41\u4f53\u4efb\u52a1\u76ee\u6807\u53ea\u8981\u6c42\u4f60\u7269\u54c1\u680f\u5185\u67d0\u4e2a\u5bb9\u5668\u4e2d\u6709\u76f8\u5e94\u7684\u6d41\u4f53.(\u5355\u5143\u3001\u901a\u7528\u6d41\u4f53\u5355\u5143\u3001\u5927\u578b\u5355\u5143\u3001\u5bb9\u91cf\u74f6,\u7b49\u7b49.)[/note]",
